import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import ComboBox from 'react-native-combobox';
//import { SelectList } from 'react-native-dropdown-select-list'
//import { Dropdown } from 'react-native-element-dropdown';


import styles from './estilo';

export default function tCadastrarInfo() {

    const [nome, setnome] = useState("");
    const [data_de_nasc, set_data_de_nasc] = useState("");
    const [cpf, setcpf] = useState("");
    const [celular, setcelular] = useState("");
    const [endereco, setendereco] = useState("");
    const [cidade, setcidade] = useState("");
    const [estado, setestado] = useState("");
    const [email, setemail] = useState("");
    const [senha, setsenha] = useState("");

    const estados = [
        'Acre',
        'Alagoas',
        'Amapá',
        'Amazonas',
        'Bahia',
        'Ceará',
        'Distrito Federal',
        'Espírito Santo',
        'Goiás',
        'Maranhão',
        'Mato Grosso',
        'Mato Grosso do Sul',
        'Minas Gerais',
        'Pará',
        'Paraíba',
        'Paraná',
        'Pernambuco',
        'Piauí',
        'Rio de Janeiro',
        'Rio Grande do Norte',
        'Rio Grande do Sul',
        'Rondônia',
        'Roraima',
        'Santa Catarina',
        'São Paulo',
        'Sergipe',
        'Tocantins',
    ];


    const navigation = useNavigation();

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styles.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Sejam Bem-vindo(a)</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>
                    <TextInput
                        style={styles.input}
                        placeholder="Nome Completo"
                        value={nome}
                        onChangeText={(texto) => setnome(texto)}

                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Data de Nascimento"
                        value={data_de_nasc}
                        onChangeText={(texto) => set_data_de_nasc(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="CPF"
                        value={cpf}
                        onChangeText={(texto) => setcpf(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Celular"
                        value={celular}
                        onChangeText={(texto) => setcelular(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        value={endereco}
                        placeholder="Endereço"
                        onChangeText={(texto) => setendereco(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Cidade"
                        value={cidade}
                        onChangeText={(texto) => setcidade(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="E-mail"
                        value={email}
                        onChangeText={(texto) => setemail(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Senha"
                        value={senha}
                        onChangeText={(texto) => setsenha(texto)}
                    />

                    <Text style={styles.description}>Estado</Text>

                    <ComboBox
                        style={styles.input}
                        values={estados.map((estado) => estado.nome)}
                        onValueSelect={(texto) => {
                            const estadoSelecionado = estados.find((estado) => estado.nome === texto);
                            setestado(estadoSelecionado);}}
                        //onValueSelect={(texto) => setestado(texto)}
                    //onValueSelect={setestado}
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={() => navigation.navigate('tCadastrarFoto', {
                    nome: nome, celular: celular, cpf: cpf, endereco: endereco, email: email, senha: senha,
                })}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
